import React, { Component } from "react"


function Welcome() {
    const names = ["ram", "shyam", "bhullar"]
    return (
        <div>
            {
                names.map((name)=>{
                    <h2>{name}</h2>
                })
            }
        </div>
    )
}
export default Welcome
